import React, { Component } from 'react';
import logo from './logo.svg';

class Home extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-4">
                        <from name="">
                            <input className="text1" name="text1"></input>
                        </from>
                    </div>
                    <div className="col-md-4">Heading</div>
                </div>
            </div>
        );
    }
}

export default Home;
